　医生建议：
　　1、平行型：其特点是双眼皮基本平行的，这种双眼皮显得洋气、端庄;
　　2、新月型：其特点是重睑内侧你及外侧较低，形如星月般;这样的眼睛就像小鹿那样天然可爱;
　　3、开扇型：其特点是内窄外宽，形状类似打开的折扇;这种情境的双眼皮类似醉人的“桃花眼”;
　　4、平扇形：其特点是双眼皮内侧稍窄，内眼角充分暴露;这种情境的双眼皮显得温柔，无辜。

1、手术后请遵医嘱，按时吃药，这样可以减轻术后的不适;
2、手术后一合周内避免手术部位沾水;
3、忌食辛辣刺激食物。
4、术后包扎双眼者应加强生活护理及观察，如有不适应该寻找原因，不应该随意松动敷料。
⑤ 避免组织缝合面继续渗血。可以采取用弹力绷带加压包扎、不宜过度低头、不能用力睁眼或闭眼等。
⑥ 眼睑组织受到手术创伤后，细胞间会出现反应性水肿。这属正常现象，不必担心，采取加压包扎和冷敷有助于上述现象减轻，但肿胀严重并不断发展则要及时找医生复查。

1、眼底的脂肪大面积的膨出，显得苍老者;
2、下眼睑皮肤有松弛者；
3、不想留瘢痕或不愿行外切法的轻度眼袋患者。

1、心、肺、肝、肾等重要脏器功能减退，患有高血压、糖尿病等慢性疾病者;
2、长期服用抗凝血药物、血管扩张药物、皮质类激素等药物者；
3、手术周围皮肤有炎症、感染病灶或疤痕体质者。

1、分娩时会阴部或阴道损伤后未正确缝合及治疗所致的阴道松弛者;
2、多产、难产、高龄等导致阴道严重松弛者；
3、会阴体损伤或阴道松弛所致反复出现子宫内膜炎、阴道炎、膀胱炎者;
4、因年龄增大，卵巢功能逐渐减退，雌激素量减少，使阴道周围筋膜等发生退行性变，肌张力下降。

1、心、肺、肝、肾等重要脏器功能减退，患有高血压、糖尿病等慢性疾病者;
2、皮肤有严重松弛、皮下脂肪组织少的人;
3、生理期、妊娠期或哺乳期女性；
4、吸脂、填充部位皮肤有感染病灶或疤痕体质者;
5、利多卡因过敏或麻醉药物代谢障碍人。

1、单纯眶格脂肪膨出过多且无皮肤松弛的年轻求美者；
2、伴有皮肤轻度松弛，眼部皮肤弹性较好者;
3、不想留瘢痕或不愿行外切法的轻度眼袋患者。

第一步：将唇部边缘拉出一个唇线;
第二步：拉出唇线之后，在下嘴唇打出饱满度;
第三步：再打小量的玻尿酸，去掉上嘴唇唇纹; 玻尿酸丰唇15-30分钟。注射完成后医生均匀按摩挤压注射部位，捏出想要的唇形。

1) 小腿长度：大于身高的26.3%; 
2) 圆周：大约是小腿长度的3/4; 
3) 三围尺寸：上围等于圆周，下围是上围的63%，中围是上围加下围的和除以2;

　　医生建议：
　　1、皮肤松弛、轮廓不清晰者
　　2、面部有轻微脂肪者;
　　3、组织松垂、苹果肌下滑、鼻唇沟深者;
　　4、皮肤老化、面部皱纹明显者;
　　5、希望通过非手术、无创的方式实现面部年轻化者。

1.纹刺后在创面上外用消炎药(如唇宝、芦荟胶)以防止感染，每日3次连续三天;
2.纹后三日内创面保持清洁干燥，不得沾水;
3.结痂后不宜接触热水、蒸汽等，防止痂软化、脱落，影响着色;
4.结痂后应使其自行脱落，不能人为地抠掉，以防其颜色随痂一同脱落而影响上色效果。

术前注意事项：
1、手术前一天晚上及当天早上要洗澡;
 2、手术前一周内，包括维生素E在内的所有维生素及阿司匹林一律停止使用;
3、手术前两天，不可过多的服用酒精类饮品; 4、手术当天须服用镇静剂。术后请不要驾驶车辆或从事高空作业;
 5、手术当天早餐须少量进食; 
6、手术前，患者如有其他病史或正在服用药品等相关情况，请详细告知医师。
术后注意事项：
1、手术后两至三天内，要冷敷。一周以后上午做冷敷，下午做热敷。
2、手术后两至三周内，禁止吸烟和饮酒。
3、在拆完线的一两天之后，可以洗脸和化妆，但不要用力揉眼睛。
4、两周以后方可以带隐形眼镜。
5、一个月以后，方可贴假眼睫毛。
6、两至三周以内，禁止去桑拿浴和汗蒸房。

