1.纹睫毛线后可在红肿处进行冷敷，使其尽快消肿，冷敷时应将冰块放置于冰袋内，外裹消毒毛巾进行冷敷20-30分钟，切忌不得将冰袋或冰块直接放于创面上，防止冰水渗入伤口造成感染;
2.在创面上外用消炎药以防止感染，连续三天；
3.红肿严重的可口服消炎药一般作过重睑术者文后红肿严重
